import logo from './logo.svg';
import './App.css';
import {Button} from './Button.js';
import {Link} from 'react-router-dom';

const LinkNav = () => {
  return <Link to="/">jkl</Link>;
}

const App = () => {
  return (
    <div className="App">
      <h1>Geography. What do you know about it?</h1>
      <Button className="start">Start</Button>

    </div>
  );
}

export default App;
